    //
    //     <Div_table_row>
    //     <p>EMAIL</p>
    //       <p>mark_cuban@gmail.com</p>
    //       <Hr_table_horizontal_line/>
    //
    //       <p>
    //         sdfvkjsdfglksdjhfglksdjhgf;ksdjhfgkjsdhvksdjbfv;sjdf;kajdhfgkdajhgv@gmail.com
    //       </p>
    //     </Div_table_row>
    //     <Div_table_row>
    //     <p>FOUND</p>
    //       <p>FOUND</p>
    //       <p>FOUND</p>
    //     </Div_table_row>
    //     </Div_table>
    //   </Div_table_box>
    // );

   const Table = styled.table`
   display: flex;
   flex-direction: column;
align-items: center;
justify-content: space-between;
   `

    return (
      <Div_table_box>

      <Table >
       <tr>
         <th>EMAIL</th>
         <th>FOUND</th>
      </tr>

      <tr>
        <td>1</td>
        <td>some data</td>
       </tr>

      </Table>

      </Div_table_box>
    );
  }
}

export default Table;
